import React from 'react';
import CountDown from './CountDown';

function Count() {
  const eventDate = new Date('2023-05-11');
  const eventImage = './red.jpg';

  return (
    <div>
      <h1>Proximo gran evento</h1>
      <CountDown date={eventDate} image={eventImage} />
    </div>
  );
}

export default Count;
